import React from 'react';

const Day = ({ level, handleButton }) => {
    var words = [];
    if (level === 'N5') {
        words = N5;
      }
      else if(level === 'N4'){
        words = N4;
      }
      else if(level === 'N3'){
        words = N3;
      }
      else if(level === 'N2'){
        words = N2;
      }
      else{
        words = N1;
      }


	return (
	  <div>
		<button onClick={() => handleButton(words.slice(0, 19))}>day 1</button>
	  </div>
	);
  };

  export default Day;
